import React, { useState } from 'react';
import {
  Box,
  Paper,
  Typography,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  IconButton,
  Button,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import { Delete as DeleteIcon } from '@mui/icons-material';
import { GoogleMap, useLoadScript, Marker } from '@react-google-maps/api';
import { Landmark } from '../types';

const libraries: ("places" | "drawing" | "geometry" | "visualization")[] = ["places"];

interface LandmarkListProps {
  landmarks: Landmark[];
  onAddLandmark: (landmark: Landmark) => void;
  onStartNavigation: () => void;
}

const LandmarkList: React.FC<LandmarkListProps> = ({
  landmarks,
  onAddLandmark,
  onStartNavigation,
}) => {
  const [open, setOpen] = useState(false);
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [selectedPosition, setSelectedPosition] = useState<{ lat: number; lng: number } | null>(null);

  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY || '',
    libraries,
  });

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = () => {
    if (name && address && selectedPosition) {
      onAddLandmark({
        id: Date.now().toString(),
        name,
        address,
        position: selectedPosition,
        isArrived: false,
      });
      setName('');
      setAddress('');
      setSelectedPosition(null);
      handleClose();
    }
  };

  const handleMapClick = (event: google.maps.MapMouseEvent) => {
    if (event.latLng) {
      setSelectedPosition({
        lat: event.latLng.lat(),
        lng: event.latLng.lng(),
      });
    }
  };

  if (loadError) {
    return <Typography color="error">Error loading Google Maps</Typography>;
  }

  return (
    <Box>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h4">Landmarks</Typography>
        <Button variant="contained" color="primary" onClick={handleOpen}>
          Add Landmark
        </Button>
      </Box>

      <Paper sx={{ p: 2, mb: 3 }}>
        <List>
          {landmarks.map((landmark) => (
            <ListItem key={landmark.id}>
              <ListItemText
                primary={landmark.name}
                secondary={landmark.address}
              />
              <ListItemSecondaryAction>
                <IconButton edge="end" aria-label="delete">
                  <DeleteIcon />
                </IconButton>
              </ListItemSecondaryAction>
            </ListItem>
          ))}
        </List>
      </Paper>

      <Box sx={{ display: 'flex', justifyContent: 'flex-end' }}>
        <Button
          variant="contained"
          color="primary"
          onClick={onStartNavigation}
          disabled={landmarks.length === 0}
        >
          Start Navigation
        </Button>
      </Box>

      <Dialog open={open} onClose={handleClose} maxWidth="md" fullWidth>
        <DialogTitle>Add New Landmark</DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
            <TextField
              label="Name"
              value={name}
              onChange={(e) => setName(e.target.value)}
              fullWidth
            />
            <TextField
              label="Address"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
              fullWidth
            />
            {isLoaded && (
              <Box sx={{ height: 300, width: '100%' }}>
                <GoogleMap
                  mapContainerStyle={{ width: '100%', height: '100%' }}
                  center={{ lat: 40.7128, lng: -74.0060 }}
                  zoom={12}
                  onClick={handleMapClick}
                >
                  {selectedPosition && (
                    <Marker position={selectedPosition} />
                  )}
                </GoogleMap>
              </Box>
            )}
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained" color="primary">
            Add
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default LandmarkList;
